import { ProductsContext } from "../../contexts/shop-data.context";


const Shop = () => {

    const { products } = ProductsContext;

    return (
        <div>
            {products.map(({ name, id }) => (
                    <div key={id}>
                    <h1>{name}</h1>
                </div>
            ))}
        </div>
    )
}



export default Shop;
